import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-book-tickets',
  templateUrl: './book-tickets.component.html',
  styleUrls: ['./book-tickets.component.css']
})
export class BookTicketsComponent implements OnInit {
  movie: any;  // This should be filled by fetching data from your JSON file
  dates: Date[] = [];
  cinemas: any[] = [
    { name: 'AAA Cinemas: Ameerpet', showtimes: ['12:00 PM', '3:55 PM', '10:30 PM'] },
    { name: 'Alankar (Pratap Theatre): Langer House', showtimes: ['2:00 PM', '9:00 PM'] },
    { name: 'AMB Cinemas: Gachibowli', showtimes: ['11:45 AM', '3:50 PM', '6:25 PM'] }
  ];

  constructor() {}

  ngOnInit(): void {
    this.loadDates();
    this.loadMovieData();
  }

  loadDates() {
    let today = new Date();
    for (let i = 0; i < 7; i++) {
      let newDate = new Date(today);
      newDate.setDate(today.getDate() + i);
      this.dates.push(newDate);
    }
  }

  loadMovieData() {
    // Load movie data here, assuming you have access to a service that fetches data
    this.movie = {
      title: 'Devara - Part 1',
      genre: 'Action, Drama, Thriller'
    };
  }

  selectDate(date: Date) {
    console.log('Date selected:', date);
  }

  selectShowtime(cinema: any, time: string) {
    console.log('Showtime selected:', cinema, time);
  }
}
<div class="container">
  <!-- Movie title dynamically fetched from the JSON file -->
  <h1>{{ movie?.title }} - {{ movie?.genre }}</h1>

  <!-- Display the week from the current date -->
  <div class="date-selection">
    <div *ngFor="let i of [0, 1, 2, 3, 4, 5, 6]">
      <button (click)="selectedDate = addDays(i)">
        {{ addDays(i) | date: 'EEE, MMM d' }}
      </button>
    </div>
  </div>

  <!-- List of movie theaters and showtimes -->
  <div class="theaters">
    <div *ngFor="let theater of movieTheaters">
      <h3>{{ theater.name }}</h3>
      <div class="showtimes">
        <button *ngFor="let showtime of theater.timings" (click)="onSelectShowtime(showtime)">
          {{ showtime }}
        </button>
      </div>
    </div>
  </div>

  <!-- Proceed to seat selection -->
  <button [disabled]="!selectedShowtime" (click)="onProceedToSeats()">Proceed to Seat Selection</button>
</div>
